import './OurWork.css';

import { Container } from "react-bootstrap";

function OurWork(){
    $('.owl-carousel').owlCarousel({
        loop:true,
        margin:10,
        nav:true,
        responsive:{
            0:{
                items:1
            },
            600:{
                items:3
            },
            1000:{
                items:5
            }
        }
    })

    return(
        <Container fluid>
            <Container>
                <div className = "our-work">
                    <p>Our work</p>
                    <h1>Explore Our Portfolio</h1>

                    <div class="owl-carousel owl-theme">
                        <div className = "item">

                        </div>
                    </div>
                </div>
            </Container>
        </Container>
    )
}

export default OurWork
